import React from 'react';
import logo from './logo.png';
import './App.css';

function App() {
  return (
    <div className="App">
      <div className="container_div">
        <img src={logo} className="tomato-logo" alt="logo" />
        <p>
          Use your pomodoro timer to be more productive.
        </p>
        <div id="time">
          <h2>00:00</h2>
        </div>
      </div>
    </div>
  );
}

export default App;
